import { FunctionComponent } from "react";
import { Product } from "../../App";
import "./table.scss";

export const Table = (product: any) => {
    const { id, name, color, year, pantone_value } = product.product as Product;

    const style = {
        backgroundColor: color,
    };
    return (
        <tr style={style}>
            <td>{id}</td>
            <td>{name}</td>
            <td>{color}</td>
            <td>{year}</td>
            <td>{pantone_value}</td>
        </tr>
    );
};

